import { BaseBusinessColumn } from '@/js/BusinessColumn.js';

const BussinessFieldType = {
  BussinessFieldTypeDefault: 0, //初始化
  BussinessFieldTypeInputCommon: 1, //输入框不限制
  BussinessFieldTypeMutiText: 2, //多行文本,根据编辑权限看是否可以输入
