  BussinessFieldTypeInputAmount: 4, //输入框金额
  BussinessFieldTypeSelect: 5, //左右展示 + ">" 单选
  BussinessFieldTypeAssociatedData: 6, //关联数据
  BussinessFieldTypeDate: 7, //日期 字符串
  BussinessFieldTypeCheckBox: 8, //复选 唯一，标记完成
  BussinessFieldTypeAttachment: 9, //附件
  BussinessFieldTypeNewProgress: 10, //进度 唯一
  BussinessFieldTypeDetailParent: 11, //明细或者子表
  BussinessFieldTypeMultiSelect: 15, //多选
  BussinessFieldTypePureText: 16, //纯文本
  BussinessFieldTypeJianGang: 18, //兼岗
